import React from 'react'

export const Admin = () => {

    fetch('https://fakestoreapi.com/products', {
        method: "POST",
        body: JSON.stringify(
            {
                title: 'test product',
                price: 13.5,
                description: 'lorem ipsum set',
                image: 'https://i.pravatar.cc',
                category: 'electronic'
            }
        )
    })
        .then(res => res.json())
        .then(json => console.log(json))
        .then(() => fetch('https://fakestoreapi.com/products/21'))
        .then(newRes => newRes.JSON())


    return (
        <div>Admin</div>
    )
}
